import React, {Component} from "react";
import logo from './logo.svg';
import './App.css';

class HelloMessage extends React.Component {
  render() {
    return (
      <div>
        Hello {this.props.name}
      </div>
    );
  }
}

ReactDOM.render(
  <HelloMessage name="World" />,
  document.getElementById('hello-example')
);

export default App;
